import React from "react";


const LoginForm = (props) => {
  return (
    <form>
      <div>
        <input placeholder={"Username"}></input>
      </div>
      <div>
        <input placeholder={"Password"}></input>
      </div>
      <div>
        <input type={"checkbox"}></input> Remember me
      </div>
      <div>
        <button>Login</button>
      </div>
    </form>
  );
};

export default LoginForm;
